import VueRouter from 'vue-router'
import Vue from 'vue'

Vue.use(VueRouter)

const routes =
    [
    {
        path: '/datastc',
        name: 'datastc',
        component: () => import('../components/DS.vue'),
        children: [
            {path: '/oriented',component: () => import('../components/DS_graph_or.vue') }
        ] 
    },
    {
        path: '/algintro',
        name: 'algintro',
        component: () => import('../components/AlgIntro.vue') 
    },
    {
        path: '/algcmp',
        name: 'algcmp',
        component: () => import('../components/AlgCmp.vue') 
    },
    {
        path: '/literature',
        name: 'literature',
        component: () => import('../components/Lit.vue') 
    },
    ]

const router = new VueRouter({
    mode: 'history',
    base: process.env.BASE_URL,
    routes
})

export default router
